DROP TABLE IF EXISTS `business_message`;
CREATE TABLE `business_message` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `business_id` varchar(50) NOT NULL,
  `name` text NOT NULL,
  `branch_name` text COMMENT '分店名称',
  `address` text NOT NULL,
  `telephone` varchar(20) DEFAULT NULL,
  `regions` varchar(10) NOT NULL COMMENT '所在商区',
  `categories` varchar(10) NOT NULL COMMENT '所属类型',
  `latitude` float(12,8) DEFAULT NULL COMMENT '维度',
  `longitude` float(12,8) DEFAULT NULL COMMENT '经度',
  `avg_rating` float DEFAULT NULL COMMENT '星级评分，5.0代表五星，4.5代表四星半，依此类推',
  `rating_img_url` text COMMENT '星级图片链接',
  `rating_s_img_url` text COMMENT '小尺寸星级图片链接',
  `product_grade` int(11) DEFAULT NULL COMMENT '产品/食品口味评价，1:一般，2:尚可，3:好，4:很好，5:非常好',
  `decoration_grade` int(11) DEFAULT NULL COMMENT '环境评价，1:一般，2:尚可，3:好，4:很好，5:非常好',
  `service_grade` int(11) DEFAULT NULL COMMENT '服务评价，1:一般，2:尚可，3:好，4:很好，5:非常好',
  `avg_price` int(11) DEFAULT NULL COMMENT '人均价格，单位:元，若没有人均，返回-1',
  `review_count` int(11) DEFAULT NULL COMMENT '点评数量',
  `business_url` text COMMENT '商户页面链接',
  `photo_url` text COMMENT '照片链接',
  `s_photo_url` text COMMENT '小尺寸照片链接，照片最大尺寸278×200',
  `has_coupon` int(11) DEFAULT NULL COMMENT '是否有优惠券，0:没有，1:有',
  `coupon_id` text COMMENT '优惠券ID',
  `coupon_url` text COMMENT '优惠券链接',
  `coupon_description` text COMMENT '优惠描述',
  `has_deal` text COMMENT '团购ID',
  `city` text,
  `distance` text,
  `deal_count` text,
  `rank_score` int(11) DEFAULT '0' COMMENT '评分',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8;

